import React from "react";
import { Bar } from "react-chartjs-2";

const TestA = (props) => {
  const entries = props.filteredEntries;

  const timeNumberfied = entries.map((entry) =>
    parseFloat(
      `${entry.time.split(":")[0]}.${
        (entry.time.split(":")[1] / 60).toString().split(".")[1]
      }`.slice(0, 5)
    )
  );

  const xData = timeNumberfied;
  const yData = entries.map((entry) => entry.attendee_count);
  const combined = [];
  for (let i = 0; i < entries.length; i++) {
    const x = xData[i];
    const y = yData[i];
    const both = { x: x, y: y };
    combined.push(both);
  }

  console.log("combined", combined);

  var barValues = [
    {
      x: 355,
      y: 1,
    },
    {
      x: 401,
      y: 2,
    },
    {
      x: 409,
      y: 7,
    },
    {
      x: 417,
      y: 4,
    },
    {
      x: 425,
      y: 0,
    },
    {
      x: 433,
      y: 3,
    },
    {
      x: 441,
      y: 2,
    },
    {
      x: 449,
      y: 1,
    },
    {
      x: 457,
      y: 0,
    },
  ];

  var lineValues = [
    {
      x: 8,
      y: 0,
    },
    {
      x: 9,
      y: 0,
    },
    {
      x: 10,
      y: 0,
    },
    {
      x: 11,
      y: 0,
    },
    {
      x: 12,
      y: 0,
    },
    {
      x: 13,
      y: 0,
    },
    {
      x: 14,
      y: 0,
    },
    {
      x: 15,
      y: 0,
    },
    {
      x: 16,
      y: 0,
    },
    {
      x: 17,
      y: 0,
    },
    {
      x: 18,
      y: 0,
    },
    {
      x: 19,
      y: 0,
    },
    {
      x: 20,
      y: 0,
    },
    {
      x: 21,
      y: 0,
    },
    {
      x: 22,
      y: 0,
    },
    {
      x: 23,
      y: 0,
    },
    {
      x: 24,
      y: 0,
    }
  ];

  function barValue(x) {
    for (let barValue of combined) {
      if (Math.floor(x) == barValue.x) {
        return barValue.y;
      }
    }
    return 0;
  }

  return (
    <div>
      <Bar
        type="bar"
        data={{
          labels: combined.map((v) => v.x),
          datasets: [
            {
              backgroundColor: "#000",
              borderWidth: 2,
              fill: false,
              data: lineValues.map((v) => barValue(v.x)),
              yAxisID: "A",
            },
          ],
        }}
        options={{
          responsive: true,
          legend: {
            display: false,
          },
          scales: {
            xAxes: [
              {
                display: true,
                ticks: {
                  maxTicksLimit: 10,
                  callback: (value) => Math.floor(value),
                },
              },
            ],
            yAxes: [
              {
                id: "A",
                display: true,
                type: "linear",
              },
            ],
          },
        }}
      />
    </div>
  );
};

export default TestA;
